    expect(rawData).toEqual('File content');

    const binaryData = fs.readFileSync('files/binary');
    expect(binaryData).toBeInstanceOf(Buffer);
    expect(binaryData.toJSON()).toEqual({ data: [4, 3, 1, 2], type: 'Buffer' });
  })

